function wzjl(timeout = 0) {
    return new Promise((resolve) => {
        let url = {
            url : 'https://kandian.wkandian.com/v5/article/complete.json',
            headers : {
                'device-platform': 'android',
                'Content-Type': 'application/x-www-form-urlencoded',
                'Content-Length': zq_wzbody1.length.toString(),
                'Host': 'kandian.wkandian.com'
            },
            body : zq_wzbody1,
        }
        $.post(url, async (err, response, data) => {
            try {
                const result = JSON.parse(data)
                if(result.items.read_score){
                    console.log('浏览文章成功，获得：'+result.items.read_score + '金币\n')
                    randomtime = Math.floor(Math.random()*(max-min+1)+min)*1000 //随机延迟
                    console.log(`随机延迟：${randomtime/1000}秒\n`)
                    await $.wait(randomtime)
                }else{
                    console.log('看太久了，换一篇试试\n')
                    await $.wait(2000)
                }
            } catch (err) {
                $.logErr(err);
            } finally {
                resolve()
            }
        },timeout)
    })
}

